import re

def transform_string(s):
    # Replace spaces with line breaks
    s = s.replace(' ', '\n')
    
    # Replace OP_PUSHNUM_{X} with {X} for X between 1 and 15
    def replace_pushnum(match):
        num = int(match.group(1))
        return str(num) if 1 <= num <= 16 else match.group(0)
    
    # Replace OP_PUSHNUM_{X} with {X} for X between 1 and 15
    def replace_pushbytes(match):
        num = int(match.group(1))
        return '' if 1 <= num <= 15 else match.group(0)
    
    s = re.sub(r'OP_PUSHNUM_(\d+)', replace_pushnum, s)
    s = re.sub(r'OP_PUSHBYTES_(\d+)', replace_pushnum, s)
    
    return s
